import { Layout } from 'antd'
import { Content } from 'antd/es/layout/layout'
import { useNavigate } from 'react-router-dom'
import axios from 'axios'
import React, { useEffect } from 'react'
import { useState } from 'react'
import Footer from '../../components/Footer'
import Header from '../../components/Header'
import NavBar from '../../components/NavBar'
import DivetPbBlurbContent from './DivetPbBlurbContent'
import './homePage.css'
import Slider from '../../components/Slider'
const API_URL = process.env.REACT_APP_API_URL;



const HomePage = () => {
  const navigate = useNavigate();
  const [cards , setCards] = useState([]);
  const [about , setAbout] = useState([]);
  const [benifits, setBenifits] = useState([]);
  const [benifitsImage, setBenifitsImage] = useState([]);
  const [description, setDescription] = useState([]);
  const [AbtDesc, setAbtDesc] = useState([]);
  const [abtCard, setAbtCard] = useState([]);
  const [abtImage, setAbtImage] = useState([]);

useEffect(() => {
  Home();
}, []);

var isValid = cards && about && benifits && description && AbtDesc && abtCard;
console.log(isValid);

const Home = async() => {
  try{
    try{
      const response = await axios.get(`${API_URL}/api/pages/1?populate[0]=BenefitsOfIHF&populate[1]=BenefitsOfIHF.Image`);
      setBenifits(response.data.data.attributes.BenefitsOfIHF);
      setBenifitsImage(response.data.data.attributes.BenefitsOfIHF.Image.data.attributes.url);
      setDescription(response.data.data.attributes.BenefitsOfIHF.Description[0].children);
      console.log(benifits,'benifits');
    }catch(e){
      console.error(e);
    }
    try{
      const response = await axios.get(`${API_URL}/api/pages/1?populate[cards][populate]=*`);
      setCards(response.data.data.attributes.cards);
      console.log(response.data,'Home');
    }catch(e){
      console.error(e);
    }

    try{
      const response = await axios.get(`${API_URL}/api/pages/1?populate[blocks][populate]=*`);
      setAbout(response.data.data.attributes.blocks[2]);
      setAbtCard(response.data.data.attributes.blocks);
      setAbtImage(response.data.data.attributes.blocks[2].Image.data.attributes.url);
      // setAbtCard(abtCard.slice(-3));
      setAbtDesc(response.data.data.attributes.blocks[2].Description[0].children);
      console.log(abtCard,'Blocks');
    }catch(e){
      console.error(e);
    }
  }catch(err){

  }
 
}

  return (
      <div className="container bg-black">
   <NavBar/>
 <Slider/>
    <main className="frame-parent ">
    <section className="divet-pb-row-wrapper">
      <div className="divet-pb-row ">
        {cards.map((card)=>(
          <div  className="divet-pb-blurb-content1 " key={card.id}>
            <a onClick={()=>{navigate(`${card.href}`)} }>
          <img
            className="link-events-300x300png"
            loading="lazy"
            alt=""
            src={`${API_URL}${card.Image.data.attributes.url}`}/>
          <div className="heading-4-link-masterclass-wrapper">
            <div className="heading-4-container">
              <p className="masterclasses-online">{card.Title}</p>
            </div>
          </div>
        </a>
        </div>
        ))}
        </div>
    </section>



    <section className="self-stretch flex flex-col items-center justify-center pt-0 px-0 pb-10 box-border max-w-full">
    <div className=" flex flex-col items-center justify-center  box-border  max-w-full shrink-0 text-left text-6xl text-[#C5C6C7]  mq925:gap-[20px] mq925:pt-[42px] mq925:px-[25px] mq925:pb-[25px] mq925:box-border mq1350:pt-[65px] mq1350:px-[210px] mq1350:pb-[39px] mq1350:box-border">
      <div className=" flex flex-row items-center justify-evenly px-[150px] text-wrap gap-[59.4px] max-w-full mq925:gap-[30px] ">
        <img
          className="h-auto flex-1 relative max-w-full overflow-hidden object-cover min-w-[331px]"
          alt=""
          src={`${API_URL}${abtImage}`}
        />
        <div className="w-[498.7px] flex flex-col items-start justify-start gap-[15px] min-w-[498.7px] max-w-full mq1825:min-w-full mq1350:flex-1">
          <div className="self-stretch flex flex-col items-start justify-start gap-[9.1px] max-w-full">
            <h2 className="m-0 relative text-inherit tracking-[1px] leading-[50px] uppercase font-normal font-inherit mq450:text-xl mq450:leading-[40px]">
              {about.Title}
            </h2>

            <div className=" flex flex-col text-wrap overflow-y-hidden  max-w-full text-mini text-white">
             {AbtDesc.map((abt)=>(
              <ul className="relative w-">
                <li className="m-0">
                  {abt.children[0].text}
                </li>
              </ul>
             ))} 

            </div>
          </div>
        </div>
      </div>


      {abtCard.slice(-3).map((card)=>( <div className="self-stretch  flex flex-column items-start justify-center py-[60px] px-5 box-border max-w-full shrink-0 z-[1] mt-[-0.1px] text-center text-lg text-darkslategray-200 font-open-sans mq925:pb-[39px] mq925:box-border">
      <div className="w-[1080px]  grid flex-row items-start justify-start py-10 px-0 box-border gap-[59.4px] max-w-full grid-cols-[repeat(3,_minmax(240px,_1fr))] mq450:pt-[60px] mq450:pb-[26px] mq450:box-border mq925:gap-[30px] mq925:justify-center mq925:grid-cols-[minmax(240px,_1fr)]">
        <div className="h-[371px] backdrop-blur-sm bg-gray1  hover:backdrop-brightness-150 flex flex-row items-start justify-start pt-2.5 px-2.5 pb-5 box-border max-w-full">
       
        <div key={card.id} className="self-stretch flex-1 flex flex-col items-end justify-start pt-0 px-[0.2px] pb-2.5 gap-[30px]">
            <img
              className="self-stretch flex-1 relative max-w-full overflow-hidden max-h-full object-cover"
              alt=""
              src={`${API_URL}${card.Image.data.attributes.url}`}
            />
            <div className="self-stretch flex flex-row items-start justify-end py-0 pr-[72.2px] pl-[72px] mq450:pl-5 mq450:pr-5 mq450:box-border">
              <div className="flex-1 relative leading-[18px] uppercase text-white ">
                {card.Title}
              </div>
            </div>
          </div>
       


        </div>
      </div>
    </div>
    ))}
    </div>

 

        </section>


      <section className="value-comparator">
      <div className="input-filter-parent">
          <div className="input-filter" >
          <h2 className="heading-31">{benifits.Title}</h2>
          <div className='justify-between flex gap-10 '>
            <div className="we-allow-students-more-one-on-parent flex flex-col" >
          {description.map((ben)=>(
            <ul className="we-allow-students-container">
              <li className="we-allow-students ">
              {ben.children[0].text}
              </li>
            </ul>
        ))}
        </div> 
         <img
          className="toa-heftiba-h8y-8tbksnw-unspla-icon"
          alt=""
          src={`${API_URL}${benifitsImage}`}
        />
          </div>
        </div>
      </div>
    </section>
    <Footer/>
    </main>
  </div>
  )
}

export default HomePage
